extern "C"
{
    void mlp(hls::stream<axis_t> &in, hls::stream<axis_t> &out)
    {
_ssdm_op_SpecInterface(0, "s_axilite", 0, 0, "", 0, 0, "control", "", "", 0, 0, 0, 0, "", "");
_ssdm_op_SpecInterface(&in, "axis", 1, 1, "both", 0, 0, "", "", "", 0, 0, 0, 0, "", "");
_ssdm_op_SpecInterface(&out, "axis", 1, 1, "both", 0, 0, "", "", "", 0, 0, 0, 0, "", "");

 int8_t sample[64];
        int16_t prediction[10];
_ssdm_SpecArrayPartition( sample, 1, "CYCLIC", 8, "");
_ssdm_SpecArrayPartition( prediction, 1, "CYCLIC", 2, "");

 const int j_limit = 256 / 8;
        const int i_limit = 64 / j_limit;

        int low;
        int high;

    load_sample:
        for (int i = 0; i < i_limit; i++)
        {
            low = 0;
            high = 8 - 1;

            axis_t temp = in.read();
            for (int j = 0; j < j_limit; j++)
            {
                sample[i * 16 + j] = temp.data.range(high, low);

                low += 8;
                high += 8;
            }
        }

        mlp_kernel(sample, prediction);

    write_prediction:
        for (int i = 0; i < i_limit; i++)
        {
            axis_t temp;
            low = 0;
            high = 16 - 1;

            for (int j = 0; j < j_limit; j++)
            {
                temp.data.range(high, low) = prediction[i * 16 + j];

                low += 16;
                high += 16;
            }

            ap_uint<1> last = 0;
            if (i == i_limit - 1)
            {
                last = 1;
            }

            temp.last = last;
            temp.keep = -1;

            out.write(temp);
        }
    }
}
